☃️Добрый вечер,мои верные друзья😘 Сегодня я для вас приготовила невероятно вкусную,сытную солянку😱 По сути, это наваристый мясной суп, который готовится из нескольких видов мяса, с добавлением соленых огурцов😍маслин(оливок),лимона и петрушки👍 Это неизменные ингредиенты классического и моего ЛЮБИМОГО рецепта😍 ❄️Друзья, а какой у вас любимый суп?😏 Отвечайте ниже↙️
❄️Ингредиенты:
▪️Свинина 300 гр ▪️Копчённая колбаса(сервелат) 150 гр ▪️Полукопчёная колбаса 150 гр ▪️Соленый огурец 2 шт ▪️Рис 0.5 стакана
▪️Лук репчатый 1 шт ▪️Морковь свежая 1 шт ▪️Томатная паста 2 ст/л
▪️Оливки/лимон на свой вкус
▪️Соль/молотый перец по вкусу
❄️Приготовление↙️
✔️Свинину промываем и кладём в кипящую соленую воду. Переодически снимаем пенку. По готовности куски свинины необходимо достать а бульон оставить(предварительно процедив)
✔️Пока мясо вариться, необходимо мелко нарезать лук; натереть морковь на терке; нарезать соломкой копчёную/полукопчёную колбасу и соленые огурцы.
✔️На следующем этапе обжариваем репчатый лук и морковь. К ним отправляем колбасы и солёный огурец. В конце добавляем 2 ст/л томатной пасты и обжариваем ещё 3-5 минут.
✔️В кастрюлю с бульоном погружаем луковую томатную заправку и варим 5 минут. (При необходимости можно добавить соль и молотый перец)
Затем добавляем нарезанную свинину и сразу же погружаем рис. Варим 15 минут.
✔️На последнем этапе добавляем зелень и оливки, варим ещё 10 минут. Накрываем крышкой и даём солянке настояться хотя бы 15 минут.
🌪Вуа-ля, ароматная и самая вкусная домашняя солянка готова😜 Разливаем по тарелкам и в каждую тарелку кладём ломтик лимона и посыпаем зеленью🤤Перед употреблением добавляем ложечку сметаны😋
✅Всем приятного аппетита!

